import React from 'react';
import './App.scss';
import Navigation from './components/Navigation/Navigation.js'
import Menu from './components/Menu/Menu.js'
import Main from './components/Main/Main.js'

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <Navigation />
        <Menu />
        <Main />
      </div>
    );
  }

}

export default App;
